import React from "react";
import { MainMenuButton } from "./MainMenuButton";
import { getUrnik } from './buttonFunctions';
const MainMenu = (props) => {


    return(
        <React.Fragment>
            <div className="button-container">
                < MainMenuButton buttonText="Urnik" handleClick={getUrnik}/>
                < MainMenuButton buttonText="Inventura" handleClick={() => console.log("Inventura")}/>
                < MainMenuButton buttonText="Sprejem" handleClick={() => console.log("Sprejem")}/>
                < MainMenuButton buttonText="Odpis" handleClick={() => console.log("Urnik")}/> 
            </div>
        </React.Fragment>
    )
}

export { MainMenu };
